  input: TEXT,F3A,,"1)  The 'Gated Receipts' entry that appears for October 24, 2006,
    for the amount of $505.00 represents cash receipts for individual ticket purchases
    at the door on October 22, 2006, for the fundraiser at the Seafood Chef Restaurant.  Tickets
    were sold at the door for $25; in some cases individuals did not pay full price
    for the tickets.  The aggregate receipts is $505.00, and was deposited on October
    24, 2006.  2)  This report was amended on July 23, 2007.  The dates of receipt
    for thirty-one itemized receipts and one unitemized receipt disclosed in this
    report were amended to reflect that date upon which the Committee to Elect Madeleine
    Z. Bordallo received control over the contribution.  In each case the contribution
    was made at a fundraiser held on November 5, 2006.  Previous dates for these contributions
    were reported in error by the Committee to Elect Madeleine Z. Bordallo.  The Committee
    to Elect Madeleine Z. Bordallo herein amends this report to reflect the accurate
    date for these contributions that are credited to the 2006 election cycle.   This
    amended report is filed in response to the FEC correspondence to the Committee
    to Elect Madeleine Z. Bordallo that is dated June 22, 2007, and that is in reference
    to the 30 Day Post-General Report (10/19/06-11/27/06)."
